import ColorLensOutlinedIcon from '@material-ui/icons/ColorLensOutlined';
import { withRouter } from 'react-router-dom';
class Color extends Component {
    render() {
        return (
            <div>
                <ColorLensOutlinedIcon />
            </div>
        )
    }
}
export default  withRouter(Color)
